import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const Carousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <div className="supercontainer">
      <Slider {...settings}>
        <div className="slider-section">
          <img src="./" alt="Image 1"/>
        </div>
        <div className="slider-section">
          <img src="../SKINS/arma11.png" alt="Image 2"/>
        </div>
        <div className="slider-section">
          <img src="../SKINS/skin18.png" alt="Image 3"/>
        </div>
        <div className="slider-section">
          <img src="../SKINS/arma2.png" alt="Image 4"/>
        </div>
      </Slider>
    </div>
  );
};

export default Carousel;
